expression:
SELECT ?identifier ?title
WHERE {
    ?record custmabxml:metadata ?metadata ;
            custmabxml:header ?header .
    ?header custmabxml:identifier ?identifier .
    ?metadata m:record ?mabrecord .
    ?mabrecord m:datafield ?dataField .
    ?dataField m:tag "088" ;
               m:ind1 "a" ;
               m:subfield ?subField .
    ?subField rdf:value ?url .
}
